import React from 'react'
import './css/Banner.css'


const Banner = () => {
  return (
    <div class="banner">
        <div class="banner-left">
            <h1>Humanizando <br /> seu seguro</h1>
            <p>
            Podemos já vislumbrar o modo pelo qual a determinação clara de objetivos prepara-nos para enfrentar situações atípicas decorrentes dos conhecimentos estratégicos para atingir a excelência. Todas estas questões, devidamente ponderadas, levantam dúvidas sobre se o início da atividade geral de formação de atitudes ainda não demonstrou convincentemente que vai participar na mudança do sistema de participação geral. A prática cotidiana prova que o comprometimento entre as equipes cumpre um papel essencial na formulação do fluxo de informações. Pensando mais a longo prazo, a execução dos pontos do programa possibilita uma melhor visão global dos índices pretendidos.

            </p>
        </div>
        <div class="banner-img-right"></div>
    </div>
  );
}

export default Banner;
